function getRandomColorBit()
    local bit = string.format("%x", UMath:GetRandomInt(128,255))
    -- print("getRandomColorBit ", bit)
    return bit
end


function getRandomColorRGBA()
    local color = string.format("#%s%s%sFF", getRandomColorBit(), getRandomColorBit(), getRandomColorBit())
    -- print("getRandomColorRGBA ", color)
    return color
end



function genUnitsFromNote(midiAio, note, musicIdx, trackIdx, noteIdx)
    local pos = Engine.Vector(genUnitsOrgPos.x, genUnitsOrgPos.y - note.tickOn * midiAio.timePerBitMs / 1000.0 * 650, genUnitsOrgPos.z - 400)
    local callback = function(elementId)
        print("SpawnElement res ", elementId)
        note.eid = elementId
        print("SpawnElement eid ", MiscService:Table2JsonStr(note))
        local color = getRandomColorRGBA()
        -- print("SetColor eid ", MiscService:Table2JsonStr(note))
        -- print("SetColor CC", color)
        Element:SetColor(elementId, 1, color)

        CustomProperty:SetCustomProperty(elementId, "musicVec", CustomProperty.PROPERTY_TYPE.Vector, Engine.Vector(0, trackIdx, noteIdx))
    end
    Element:SpawnElement(Element.SPAWN_SOURCE.Config, 1101002001034000, callback, pos, Engine.Rotator(0,0,0), Engine.Vector(10, 1, 1), false)
end



function playSingleNote(midiAio, note)
    print("playSingleNote 1", MiscService:Table2JsonStr(note))

    -- TimerManager:AddTimer(2, Audio:PlaySFXAudio2D(note.note,2,100,0))
    local durationNote = (note.tickOff - note.tickOn) * midiAio.timePerBitMs / 1000.0
    --500014
    -- local noteRemap = math.floor(note.note / 128.0 * 128)
    local noteRemap = note.note - 40 + 500014
    local ins = instruments[midiAio.ins]
    if midiAio.ins == "pianob" then
        noteRemap = note.note + ins.min - 40
    elseif midiAio.ins == "guitar" then
        noteRemap = note.note + ins.min - 40
    end
    noteRemap = math.min(noteRemap, ins.max)
    noteRemap = math.max(noteRemap, ins.min)
    
    Audio:PlaySFXAudio2D(noteRemap, durationNote, 100, 0)
    -- Audio:PlaySFXAudio2D(500001 + 23, 0.2, 100, 0)
end

function GetNoteFromData(nd)
    local myNote = {note=nd[1], tickOn=nd[2], tickOff=nd[3]}
    return myNote
end

function checkAllMusic()
    -- print("checkAllMusic 1", MiscService:Table2JsonStr(musicAll))
    if flagCheckingMusicAll then
        return
    else
        flagCheckingMusicAll = true
    end

    for name, midiAio in pairs(musicAll) do
        checkMusicTracks(midiAio)
    end

    flagCheckingMusicAll = false
end

function checkMusicTracks(midiAio)
    print("checkAllTracks 1 ",  TimerManager:GetTimeSeconds(), " ", midiAio.cuePosMs)
    -- TimerManager:AddTimer(1,Audio:PlaySFXAudio2D(500001 + 23, 0.2, 100, 0))
    -- TimerManager:AddTimer(1,Audio:PlaySFXAudio2D(500001 + 18, 0.2, 100, 0))
    -- TimerManager:AddTimer(1,Audio:PlaySFXAudio2D(500001 + 21, 0.2, 100, 0))
    
    if midiAio.cuePosMs == 0 then
        midiAio.cuePosMs = TimerManager:GetTimeSeconds()
    end
    

    for j=1,#midiAio.tracks do
        local track = midiAio.tracks[j]
        print("checkAllTracks 2 ", track.cueNoteIdx, " ", #track.nds)

        for i=track.cueNoteIdx + 1, #track.nds do
            local nd = track.nds[i].ds
            local myNote = GetNoteFromData(nd)
            print("myNote ", MiscService:Table2JsonStr(myNote))
            local playStartedDelta = TimerManager:GetTimeSeconds() - midiAio.cuePosMs
            local noteStartDelta = myNote.tickOn * midiAio.timePerBitMs / 1000.0
            local startDelay = noteStartDelta - playStartedDelta
            print("checkAllTracks 3 ", startDelay, " ", playStartedDelta, " ", noteStartDelta)
            if (midiAio.genNoteDelay > 0) and (startDelay > midiAio.genNoteDelay) then
                break
            end
            track.cueNoteIdx=track.cueNoteIdx + 1

            if genUnits then
                genUnitsFromNote(midiAio, myNote, 0, j, i)
            else
                TimerManager:AddTimer(startDelay, playSingleNote, midiAio, myNote)
            end
            
            -- playSingleNote(midiAio, note)
           
        end

    end
    
end


function OnCharacterTouchUnit(characterId, eid)
    print("onCharacterTouchUnit ", characterId, " ", eid)
    
    local musicVec = CustomProperty:GetCustomProperty(eid,"musicVec", CustomProperty.PROPERTY_TYPE.Vector)
    if musicVec ~= nil then
        -- print("onchar musicvec ", musicVec.y, " ", musicVec.z, " ", MiscService:Table2JsonStr(midiAio1.tracks[musicVec.y].nds[musicVec.z]))
        local note = GetNoteFromData(midiAio1.tracks[musicVec.y].nds[musicVec.z].ds)
        System:SendToAllClients(msgIdPlayNote, note)
        -- playSingleNote(midiAio1, note)
    end
    
end


function StartCheckMusic(midiAio)
    print("checkAllMusic start1 ")
    
    TimerManager:AddLoopTimer(2, checkAllMusic)
end

function OnNotifyPlayNote(msgId, msg)
    -- print("OnNotifyPlayNote")
    playSingleNote(midiAio1, msg)
end

function InitMusicClient()
    print("InitMusicClient")
    InitMusic()
    System:BindNotify(msgIdPlayNote, OnNotifyPlayNote)
end

function InitMusic() 
    print("InitMusic")
    
    -- midiAio1 = MiscService:JsonStr2Table(music1)
    TimerManager:AddTimer(2, StartCheckMusic)

    local callback = function(eid)
        Element:SetSkinParams(eid,{FlowSpeed = 1.0, WaterSpeed=2.0, DisturbSpeed=1.0})
    end

    Element:SpawnElement(Element.SPAWN_SOURCE.Config, 1103019010001000, callback, genUnitsOrgPos, Engine.Rotator(0,0,0), Engine.Vector(1, 1, 1), false)
end

function getMusicData(name)
    local varName = string.format("%s%s", name, musicDataPrefix)
    local musicData = _G[varName]
    -- print("PlayMusic musicData ", varName, " ", musicData)
    local music = MiscService:JsonStr2Table(musicData)
    music.genNoteDelay = 10
    music.ins = "piano"
    return music
end

--loopTimes -1 表示一直循环
function PlayMusic(name, instrument, loopTimesVar)
    local music = musicAll[name]
    if music == nil then
        music = getMusicData(name)
        music.loopTimes = loopTimesVar
        -- print("PlayMusic music ", MiscService:Table2JsonStr(music))
        musicAll[name] = music
    end
    music.ins = instrument
    checkAllMusic()
end

function PlaySfx(name, instrument)
    local music = getMusicData(name)
    music.genNoteDelay = 0
    music.ins = instrument
    checkMusicTracks(music)
end

